import 'dart:convert';

import 'package:flutter/material.dart';
import 'package:flutter/services.dart';

class Ornek extends StatelessWidget {
  Ornek({super.key});

  @override
  Widget build(BuildContext context) {
    String text =
        "";

    // Base64 çözme
    int mod4 = text.length % 4;
    if (mod4 > 0) {
      text += '=' * (4 - mod4);
    }
    Uint8List decodedBytes = base64.decode(text);
    return Scaffold(
      body: Container(
          width: 200,
          height: 400,
          child: Image.memory(decodedBytes, width: 450, height: 800)),
    );
  }
}
